package com.roc.cloud.db.common;/** * @ClassName: DataBaseTypeEnum * @Description: 数据库类型（0：写库 ，1：读库） * @author: Roc * @date: 2020/9/9 20:27 **/public enum DataBaseTypeEnum {    /**     * 写库     */    WRITE_DB(0, "写库"),    /**     * 读库     */    READ_DB(1, "读库"),    ;    Integer code;    String describe;    DataBaseTypeEnum(Integer code, String tenantDesc) {        this.code = code;        this.describe = tenantDesc;    }    public Integer getCode() {        return code;    }    public void setCode(Integer code) {        this.code = code;    }    public String getDescribe() {        return describe;    }    public void setDescribe(String describe) {        this.describe = describe;    }}